import styled from "styled-components";

const Title = styled.div`
  width: 100%;
`;

const WritingPage = () => {
  return (
    <>
      <Title>커뮤니티 › 게시글 작성</Title>
      <form>
        <div>
          <label>제목</label>
          <input type="text" />
        </div>
        <div>
          <label>게시글 내용</label>
          <textarea></textarea>
        </div>
        <input type="submit" value="작성 완료" />
      </form>
    </>
  );
};

export default WritingPage;
